<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<title>Rotating Mandala</title>
<style>
    body, html {
        overflow: hidden;
    }
  svg path {
    transform-box: fill-box;   /* Use the path's bounding box */
    transform-origin: center;  /* Rotate around its own center */
  }

  /* Example rotations: alternate directions and speeds */
  .rot1 { animation: rotate1 200s linear infinite; }
  .rot2 { animation: rotate2 80s linear infinite reverse; }
  .rot3 { animation: rotate3 100s linear infinite; }
  .rot4 { animation: rotate4 80s linear infinite reverse; }

  @keyframes rotate1 { from { transform: rotate(0deg); } to { transform: rotate(360deg); } }
  @keyframes rotate2 { from { transform: rotate(0deg); } to { transform: rotate(360deg); } }
  @keyframes rotate3 { from { transform: rotate(0deg); } to { transform: rotate(360deg); } }
  @keyframes rotate4 { from { transform: rotate(0deg); } to { transform: rotate(360deg); } }

</style>
